import "./VideoPage.css";
import * as texts from "../../Utilities/textForApp";
import Button from "../../components/UI/Button/Button";
import VideoImg from "../../Assets/Image.png";

export const VideoPage = () => {
  const watchVideo = () => {};

  return (
    <div className="videoPage">
      <div className="video">
        <img src={VideoImg} onClick={watchVideo} />
        <iframe
          width="100"
          height="315"
          src="https://www.youtube.com/embed/Ssbc0xi_184?controls=0&amp;start=81"
        //   title="YouTube video player"
          frameborder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowfullscreen
        ></iframe>
      </div>
      <div className="content">
        <h2>{texts.VIDEO_H2}</h2>
        <p>{texts.VIDEO_P}</p>
        <Button text={texts.VIDEO_BTN} clicked={watchVideo} type="watchNow" />
      </div>
    </div>
  );
};
export default VideoPage;
